import React, { useState } from "react";
import { createCash } from "../api/CashApi";

const NewCash = ({ onClose, onNewCash }) => {
  const [formData, setFormData] = useState({
    user_id: "",
    initial_cash: "",
    available_cash: "",
    net_pnl: "",
    cash_balance: "",
    updated_date: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log(formData);
    try {
      const newCash = await createCash({
        ...formData,
        initial_cash: parseFloat(formData.initial_cash),
        available_cash: parseFloat(formData.available_cash),
        net_pnl: parseFloat(formData.net_pnl),
        cash_balance: parseFloat(formData.cash_balance),
        user_id: parseInt(formData.user_id),
        updated_date: new Date(formData.updated_date)
          .toISOString()
          .split("T")[0], // Convert to YYYY-MM-DD format
      });
      console.log(newCash);
      onNewCash(newCash);
      alert("Cash transaction submitted successfully");
      onClose();
    } catch (error) {
      console.error("Error submitting cash transaction:", error);
      alert("Error submitting cash transaction");
    }
  };

  return (
    <div className="modal">
      <div className="new-cash-container">
        <div className="header-card">
          <p className="title">Initial Cash</p>
          <p className="close-btn" onClick={onClose}>
            &times;
          </p>
        </div>
        <hr />
        <form onSubmit={handleSubmit} className="form-container">
          <label>
            <input
              type="text"
              placeholder="User ID"
              name="user_id"
              value={formData.user_id}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <label>
            <input
              type="text"
              placeholder="Initial Cash"
              name="initial_cash"
              value={formData.initial_cash}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <label>
            <input
              type="text"
              placeholder="Available Cash"
              name="available_cash"
              value={formData.available_cash}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <label>
            <input
              type="text"
              placeholder="Net P&L"
              name="net_pnl"
              value={formData.net_pnl}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <label>
            <input
              type="text"
              placeholder="Cash Balance"
              name="cash_balance"
              value={formData.cash_balance}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <label>
            <input
              type="date"
              placeholder="Updated Date"
              name="updated_date"
              value={formData.updated_date}
              onChange={handleChange}
              required
            />
          </label>
          <br />
          <button type="submit">Add</button>
        </form>
      </div>
    </div>
  );
};

export default NewCash;
